import React, { Component } from "react";

class TaskRow extends Component {
  render() {
    const {task} = this.props;
    return (
      <tr>
        <td className="taskNumber">Task :</td>
        <td className="taskName">{task}</td>
        <td className="taskDel">
          <button>x</button>
        </td>
      </tr>
    );
  }
}

export default TaskRow;
